/* ── Banner Carousel ── */
/* ══════════════════════════════════════════════════════ */
function BannerCarousel({ onBannerClick }) {
  const [active, setActive] = useState(0);
  const banners = [
    { src: BANNER_CREDIT_HABIT, alt: "Build Your Credit Habit" },
    { src: BANNER_WELEND, alt: "WeLend Tax Season Loan" },
  ];
  const touchStart = useRef(0);
  const timerRef = useRef(null);

  const resetTimer = () => {
    if (timerRef.current) clearInterval(timerRef.current);
    timerRef.current = setInterval(() => {
      setActive((p) => (p + 1) % banners.length);
    }, 5000);
  };

  useEffect(() => { resetTimer(); return () => clearInterval(timerRef.current); }, []);
  const goTo = (i) => { setActive(i); resetTimer(); };

  return (
    <div style={{ width: "100%", display: "flex", flexDirection: "column", gap: 16 }}>
      <div style={{ display: "flex", alignItems: "center", justifyContent: "space-between" }}>
        <p style={{ ...txt(T.display1), color: T.textPrimary, margin: 0 }}>Discover</p>
        <div style={{ display: "flex", gap: 4, alignItems: "center" }}>
          {banners.map((_, i) => (
            <button key={i} onClick={() => goTo(i)} style={{
              width: i === active ? 18 : 6, height: 6, borderRadius: 3,
              border: "none", cursor: "pointer", padding: 0,
              background: i === active ? T.textSecondary : T.borders,
              transition: "all .3s ease",
            }}/>
          ))}
        </div>
      </div>
      <div
        style={{
          width: "100%", borderRadius: T.rCard, overflow: "hidden",
          position: "relative", aspectRatio: "328/200", cursor: "pointer",
        }}
        onClick={() => onBannerClick && onBannerClick(active)}
        onTouchStart={(e) => { touchStart.current = e.touches[0].clientX; }}
        onTouchEnd={(e) => {
          const diff = touchStart.current - e.changedTouches[0].clientX;
          if (Math.abs(diff) > 40) {
            const next = diff > 0 ? (active + 1) % banners.length : (active - 1 + banners.length) % banners.length;
            goTo(next);
          }
        }}
      >
        {banners.map((b, i) => (
          <img key={i} src={b.src} alt={b.alt} style={{
            position: "absolute", inset: 0, width: "100%", height: "100%",
            objectFit: "cover", borderRadius: T.rCard,
            opacity: i === active ? 1 : 0,
            transform: i === active ? "scale(1)" : "scale(1.02)",
            transition: "opacity .5s ease, transform .5s ease",
          }}/>
        ))}
      </div>
      <p style={{
        ...txt(T.body2), color: T.textSecondary, margin: 0,
        opacity: active === 1 ? 1 : 0,
        visibility: active === 1 ? "visible" : "hidden",
        transition: "opacity .4s ease",
      }}>💡 Applied? Check your email and complete the redemption form.</p>
    </div>
  );
}

